*     7(0): pfep_eXtt53 tau
*     7(1): pfep_eXtt62 tau
*     7(2): pfep_eXtt11 photon
      call smffv(lextrn,lintrn,lepina,exep_eXtt62o,exep_eXtt53o,amlp(3),
     &           amlp(3),call(1,3),cfep_eXtt62o,cfep_eXtt53o,
     &           ptep_eXtt62o,ptep_eXtt53o,eqep_eXtt11d,lt7,av7)

*     8(0): pfep_eXtt33 tau
*     8(1): pfep_eXtt53 tau
*     8(2): pfep_eXtt20 z
      call smffv(lintrn,lextrn,lepinv,exep_eXtt53o,exep_eXtt33o,amlp(3),
     &           amlp(3),czll(1,3),cfep_eXtt53o,cfep_eXtt33o,
     &           ptep_eXtt53o,ptep_eXtt33o,eqep_eXtt20c,lt8,av8)

*     9(0): pfep_eXtt4 electron
*     9(1): pfep_eXtt17 electron
*     9(2): pfep_eXtt20 z
      call smffv(lextrn,lextrn,lepinv,exep_eXtt17m,exep_eXtt4m,amlp(1),
     &           amlp(1),czll(1,1),cfep_eXtt17m,cfep_eXtt4m,
     &           ptep_eXtt17m,ptep_eXtt4m,eqep_eXtt20c,lt9,av9)

      sym = + 1.0d0
      cf  = + 1.0d0
      aprop         = cf*sym/aprop

      do 4000 mu=1,4   !!!!!!!!!!!!!!!!!!!!!!!!! 

      do ih = 1, lextrn*lextrn*lepina
        av6(ih) = av6r(ih,mu)
      enddo

      call smconv(lt6,lt7,3,3,evep_eXtt11d,av6,av7,lt10,av10)
      call smconf(lt8,lt10,1,4,exep_eXtt53o,av8,av10,lt11,av11)
      call smconv(lt9,lt11,3,2,evep_eXtt20c,av9,av11,lt,av)

      indexg(1) = 4
      indexg(2) = 2
      indexg(3) = 5
      indexg(4) = 1
      indexg(5) = 3
      indexg(6) = 6

      call aep_eXttmpord(lt, av, indexg, agcwrk)

      ancp(jgraph) = 0.0d0
*     nbase = 1
      do 500 ih = 0 , lep_eXttag-1
         atmp    = agcwrk(ih)*aprop
         agc(ih) = agc(ih) + atmp
         agcr(ih,mu) = agcr(ih,mu) + atmp
         ancp(jgraph) = ancp(jgraph) + atmp*conjg(atmp)
  500 continue

 4000 continue         !!!!!!!!!!!!!!!!!!!!!!!!! 

      return
      end
